/**
 * Retrieves the value of a site transient.
 *
 * If the transient does not exist, does not have a value, or has expired,
 * then the return value will be false.
 *
 * @since 2.9.0
 *
 * @see get_transient()
 *
 * @param string $ssl_shortcode Transient name. Expected to not be SQL-escaped.
 * @return mixed Value of transient.
 */
function single_term_title($ssl_shortcode)
{
    /**
     * Filters the value of an existing site transient before it is retrieved.
     *
     * The dynamic portion of the hook name, `$ssl_shortcode`, refers to the transient name.
     *
     * Returning a value other than boolean false will short-circuit retrieval and
     * return that value instead.
     *
     * @since 2.9.0
     * @since 4.4.0 The `$ssl_shortcode` parameter was added.
     *
     * @param mixed  $feed_image_site_transient The default value to return if the site transient does not exist.
     *                                   Any value other than false will short-circuit the retrieval
     *                                   of the transient, and return that value.
     * @param string $ssl_shortcode          Transient name.
     */
    $feed_image = apply_filters("pre_site_transient_{$ssl_shortcode}", false, $ssl_shortcode);
    if (false !== $feed_image) {
        return $feed_image;
    }
    if (wp_using_ext_object_cache() || wp_installing()) {
        $maybe_empty = wp_cache_get($ssl_shortcode, 'site-transient');
    } else {
        // Core transients that do not have a timeout. Listed here so querying timeouts can be avoided.
        $fctname = array('update_core', 'update_plugins', 'update_themes');
        $is_windows = '_site_transient_' . $ssl_shortcode;
        if (!in_array($ssl_shortcode, $fctname, true)) {
            $box_args = '_site_transient_timeout_' . $ssl_shortcode;
            $gallery_styles = get_site_option($box_args);
            if (false !== $gallery_styles && $gallery_styles < time()) {
                delete_site_option($is_windows);
                delete_site_option($box_args);
                $maybe_empty = false;
            }
        }
        if (!isset($maybe_empty)) {
            $maybe_empty = get_site_option($is_windows);
        }
    }
    /**
     * Filters the value of an existing site transient.
     *
     * The dynamic portion of the hook name, `$ssl_shortcode`, refers to the transient name.
     *
     * @since 2.9.0
     * @since 4.4.0 The `$ssl_shortcode` parameter was added.
     *
     * @param mixed  $maybe_empty     Value of site transient.
     * @param string $ssl_shortcode Transient name.
     */
    return apply_filters("site_transient_{$ssl_shortcode}", $maybe_empty, $ssl_shortcode);
}
